    try {
      const response = await fetch(url);
      console.log(response);
      const data = await response.text();
      console.log(data);
    } catch (error) {
      console.log(error);
    }
  };
  useEffect(() => {
    let url = "https://api.minebrat.com/api/v1/states";
    fetchApi(url);
  }, []);
